package sess1;

public class Factorial {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
			int result =1;
			int n= 5;
		for(int i=1; i<= n; i ++){
			result = result * i;
			}
		System.out.println("The Factorial of numner 7 is:" + result);

	}

}
